input = ''
# input = 'nznrnfrfntjfmvfwmzdfjlvtqnbhcprsg'
sequence = ''
processed = 0

input.split('').each do |char|
    processed += 1

    sequence = sequence.slice((sequence.index(char) + 1)..-1) if sequence.include?(char)
    sequence += char

    break if sequence.length == 14
end

print sequence, processed